"use strict";(self.webpackChunkknowledge=self.webpackChunkknowledge||[]).push([[6081],{1934:(e,p,t)=>{t.r(p),t.d(p,{data:()=>a});const a={key:"v-02c5b6e8",path:"/web-developer/front-end/cross-platform/yida.html",title:"宜搭",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[],filePathRelative:"web-developer/front-end/cross-platform/yida.md",git:{updatedTime:1679291328e3,contributors:[{name:"licong96",email:"licong19961204@gmail.com",commits:1}]}}},6922:(e,p,t)=>{t.r(p),t.d(p,{default:()=>r});const a=(0,t(6252).uE)('<h1 id="宜搭" tabindex="-1"><a class="header-anchor" href="#宜搭" aria-hidden="true">#</a> 宜搭</h1><p>适合收集表单，流程表单，报表展示</p><p>收集表单数据，这样的需求人力部门有很多，可是他们部门已经有自己习惯的工具在使用中</p><p>适合做的东西。我们实际在做的东西。</p><p>我已经用来宜搭，并且看了我们集团下面所有用宜搭做的应用。</p><p>宜搭的使用场景是收集表单，展示报表数据。</p><p>我回头看了我们过去的需求，人力行政部门用得到，我们的使用场景很少。</p><p>因为节假日的 H5 活动，页面 UI 设计很丰富，有动画有效果，定制化太高，宜搭里面的组件无法满足需求，还是需要自己手动开发，而且要在宜搭的规则下去开发，我们以前做好的组件无法直接在宜搭里面使用，我们需要重新开发，降低了我们的开发速度。</p><p>我们更多的作用是当人力行政部门在使用的过程中，如果遇到问题，或者有特殊需求，我们可以再提供自定义开发，而我们很少会直接用宜搭去开发应用</p><p>我用宜搭做了一些东西，而且看了我们集团下所有用宜搭做的应用，最多的使用场景是收集表单、展示报表数据</p><p>对人力行政部门来说也许用得到，我们的需求使用场景不多</p><p>总结来说，回顾我们之前的需求，我们团队的使用率很低，建议给人力部门也开个权限</p>',12),r={render:function(e,p){return a}}}}]);